import{_ as o,o as e,c as t,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 23.1-2217 Reservation of nomination by donor.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-2217.md","filePath":"vacode/23.1-2217.md"}'),a={name:"vacode/23.1-2217.md"},n=r('<h1 id="§-23-1-2217-reservation-of-nomination-by-donor" tabindex="-1">§ 23.1-2217 Reservation of nomination by donor. <a class="header-anchor" href="#§-23-1-2217-reservation-of-nomination-by-donor" aria-label="Permalink to &quot;§ 23.1-2217 Reservation of nomination by donor.&quot;">​</a></h1><p>If a donor pursuant to § <a href="http://law.lis.virginia.gov/vacode/23.1-2214/" target="_blank" rel="noreferrer">23.1-2214</a> reserves in writing as set forth in § <a href="http://law.lis.virginia.gov/vacode/23.1-2215/" target="_blank" rel="noreferrer">23.1-2215</a> to himself or to any other person the power to (i) nominate to any professorship, scholarship, or other place or appointment in the University or (ii) do any other act connected with such nomination and he or such other person fails to make such nomination in writing or do such other act within six months, the board may proceed to make such appointment or do such act.</p><p>Code 1919, § 825, § 23-84; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',3),i=[n];function s(c,h,d,p,_,l){return e(),t("div",null,i)}const v=o(a,[["render",s]]);export{m as __pageData,v as default};
